import axios from "axios";

export const getDepartmentCollection = () => ([
    {id: '1', title:'Development'},
    {id: '2', title:'Marketing'},
    {id: '3', title:'IT'},
    {id: '4', title:'Accounting'},
    {id: '5', title:'HR'},
    {id: '6', title:'Finance'}
])

export const getAll = () => ([
    axios.get('http://localhost:8080/api/v1/supplier/all').then(response => response.data.data)
])
